import React, { useState } from "react";


function App() {
  const [value, setValue] = useState(0)

  function handleChange(e) {
    setValue(value + 1)
  }

  return (
    <>
      <h1>APP PAge</h1>
      <div>{value}</div>
      <button onClick={handleChange}>+1</button>
    </>
  );
}

export default App;
